import React from 'react'; 
//import { Navbar,Nav } from 'react-bootstrap';
 //import { Link } from 'react-router-dom';
 
function navbar() {
    return (
    <nav class ="navbar navbar-expand-lg navbar-dark bg-dark">

        <ul class ="navbar-nav">
            <li class="nav-item">
              <d class="nav-link" href="" >Home</d>
            </li>
        </ul>
    </nav>
    );
}
export default navbar;
